import './App.css';
import index from './components/pages/client/index';
import "bootstrap/dist/css/bootstrap.min.css";
import { Route } from "react-router-dom";

function App() {
  return (
    <Router>
    <div>
      <div className="content">
        <Routes>
          <Route path="/" element={<Navigate to="/user/home" />} />
          {/* user */}
          
          {/* admin */}
          
        </Routes>
      </div>
    </div>
  </Router>
  );
}

export default App;
